import { useNavigate } from 'react-router-dom';

function Home() {
  const navigate = useNavigate();

  return (
    <div>
      <h1>Home</h1>
      <h2>Hola mundo</h2>
      <button onClick={() => navigate('/about')}>About</button>
    </div>
  );
}

export default Home;
